import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { TextField } from "@material-ui/core";

const useStyles = makeStyles((theme) => {});

const AddUser = () => {
  return (
    <form>
      <TextField
        type="text"
        id="outlined-basic"
        label="Username"
        variant="outlined"
      />
      <TextField
        type="number"
        id="outlined-basic"
        label="Age(Years)"
        variant="outlined"
      />
    </form>
  );
};

export default AddUser;
